import React, { useEffect, useState } from 'react';
import { getJobs, createJob, updateJob } from '../api';
export default function JobList() {
  const [jobs, setJobs] = useState([]);
  useEffect(() => { fetch(); }, []);
  const fetch = async () => setJobs((await getJobs()).data);
  const addReq = async (id) => { await updateJob(id, { requirements: ['Node.js'] }); fetch(); };
  return (
    <div>
      <h2>Jobs</h2>
      <ul>{jobs.map(j => (
        <li key={j._id}>
          {j.title} <button onClick={()=>addReq(j._id)}>Add Node.js Req</button>
        </li>
      ))}</ul>
    </div>
  );
}
